import React, { Component } from "react";

class Projects extends Component {
    render() {
        return(
            <div className="condiv projects">
                <h1>Projects</h1><br />
                <h2>Personal Website</h2>
                <h4>I wanted a website to centralize my work and to send to potential employers; it also taught me some React. I followed
                 a tutorial for this website. If you are interested, links to the tutorial and my repo for the code can be found below.
                 <br /> <br /><a href="https://codeburst.io/learn-react-js-build-a-portfolio-single-page-application-spa-ba001082a711" target="https://codeburst.io/learn-react-js-build-a-portfolio-single-page-application-spa-ba001082a711"> https://codeburst.io/learn-react-js-build-a-portfolio-single-page-application-spa-ba001082a711</a><br />
                 <a href="https://github.com/mitchellhoesing/hoesingm_website.io" target="https://github.com/mitchellhoesing/hoesingm_website.io"> https://github.com/mitchellhoesing/hoesingm_website.io </a>
                 </h4><br />
                <h2>AI Research Project</h2>
                <h4>Cannot write on this project yet.<br />Link to repo and details to come at a later date.</h4><br />
            </div>
        )
    }
}

export default Projects
